document.addEventListener("DOMContentLoaded", function () {
  // Get the container div with class "row"
  const rowDiv = document.querySelector(".row");

  // Find all div elements inside the container
  const allDivs = rowDiv.querySelectorAll("div");

  // Add the "medium" class to the first div
  allDivs[0].classList.add("medium");

  // Add the "medium" class to the last div
  allDivs[allDivs.length - 1].classList.add("medium");

  // Loop through all divs starting from the second one and up to the second-to-last one
  for (let i = 1; i < allDivs.length - 1; i++) {
    // Add the "small" class to each div
    allDivs[i].classList.add("small");
  }
});
